  NextId=0
  def __init__(self):
    self.id=Node.NextId
    Node.NextId+=1
    self.final=False
    self.edges={}
    self.count=0
  def str(self):   
    arr=[chr(48+self.final)]
    for (label,node) in sorted(self.edges.items()):arr.append(label+str(node.id))
    return "_".join(arr)
  def __hash__(self):return self.str().__hash__()
  def __eq__(self,other):return self.str()==other.str()
class Dawg:
  def __init__(self):
    self.previousWord=""
    self.root=Node()
    self.uncheckedNodes=[]
    self.minimizedNodes={}
  def insert(self,word):
    commonPrefix=0
    for i in range(min(len(word),len(self.previousWord))):
      if word[i] != self.previousWord[i]:break
      commonPrefix+=1
    self.minimize(commonPrefix)
    if len(self.uncheckedNodes)==0:node=self.root
    else:node=self.uncheckedNodes[-1][2]
    for letter in word[commonPrefix:]:
      nextNode=Node()
      node.edges[letter]=nextNode
      self.uncheckedNodes.append((node,letter,nextNode))
      node=nextNode
    node.final=True
    self.previousWord=word
  def minimize(self,downTo):
    for i in range(len(self.uncheckedNodes)-1,downTo-1,-1):
      (parent,letter,child)=self.uncheckedNodes[i]
      if child in self.minimizedNodes:parent.edges[letter]=self.minimizedNodes[child]
      else:self.minimizedNodes[child]=child
      self.uncheckedNodes.pop()
